CREATE TABLE `province`(
  `pro_id` int(11), 
  `pro_code` varchar(18), 
  `pro_name` varchar(60), 
  `pro_name2` varchar(60));
   
  

CREATE TABLE `city`(
  `id` int(11), 
  `province_id` int(10), 
  `code` varchar(18), 
  `name` varchar(60), 
  `province_code` varchar(18));

CREATE TABLE `area`(
  `id` int(11), 
  `city_id` int(10), 
  `code` varchar(18), 
  `name` varchar(60), 
  `city_code` varchar(18));




